branchCategory.description:
&lt;p&gt;
The ZSE3 series is a digital pressure switch (for vacuum pressure) with LCD readout for general pneumatics purposes. The ZSE3 digital pressure switch allows the calibration of two independent outputs. Modular version can be integrated with ZX system.
&lt;/p&gt;

